content=However, the egg only got larger and larger, and more and more human: when she had come within a few yards of it, she saw that it had eyes and a nose and mouth; and when she had come close to it, she saw clearly that it was HUMPTY DUMPTY himself. "It can't be anybody else!" she said to herself. "I'm as certain of it, as if his name were written all over his face." It might have been written a hundred times, easily, on that enormous face.

